contracts/Ethernaut/GateKeeperTwoHelper..content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

import {Util} from "../Util.sol";

contract GatekeeperTwoHelper {
  function delegate(address gateAddr, bytes8 param) public {
        (bool success, bytes memory retMsg) = gateAddr.call(abi.encodeWithSignature("enter(bytes8)", param));
        if(!success) {
            string memory errMsg = Util._getRevertMsg(retMsg);
            require(success, errMsg);
        }
    }
}

contracts/Util.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

library Util {
    function _getRevertMsg(bytes memory _returnData) internal pure returns (string memory) {
        // If the _res length is less than 68, then the transaction failed silently (without a revert message)
        if (_returnData.length < 68) return 'Transaction reverted silently';

        assembly {
            // Slice the sighash.
            _returnData := add(_returnData, 0x04)
        }
        return abi.decode(_returnData, (string)); // All that remains is the revert string
    }
}

contract Other {
    function isContract(address _addr) private returns (bool isContract){
        uint32 size;
        assembly {
            size := extcodesize(_addr)
        }
        return (size > 0);
    }
}

